import React, {Component} from 'react';

class Table extends Component {
	render () {

		const { characterData } = this.props;

		return (
			<table>
				<TableHeader />
				<TableBody characterData={characterData} />
			</table>
		);
	}
}

const TableHeader = () => {
	return (
		<thead>
			<tr>
				<th>Name</th>
				<th>Job</th>
			</tr>
		</thead>
	);
}

const TableBody = () => {
	return (
		<tbody>

        </tbody>
	);
}


export default Table;
